// SPDX-License-Identifier: MIT

pragma solidity ^0.8.6;
import "@openzeppelin/contracts/proxy/Proxy.sol";
import "@openzeppelin/contracts/utils/StorageSlot.sol";
import "@openzeppelin/contracts/utils/Address.sol"; 
contract OrderbookProxy is Proxy{    
    uint256 public orderId;
    struct Order{
        address maker;
        address makeAsset;
        uint256 makeAmount;
        address taker;
        address takeAsset;
        uint256 takeAmount;
        uint256 salt;
        uint256 startBlock;
        uint256 endBlock;
    }
    mapping(uint256 => Order) public orders; 
    address public implementation;
    event Upgraded(address indexed implementation, string version);
    constructor(address _implementation) payable {
        _setImplementation(_implementation);
    }
    function _implementation() internal view virtual override returns (address) {
        return _getImplementation();
    }
    function _getImplementationSlot() private pure returns (bytes32){
        // Equivalent to:
        return bytes32(uint256(keccak256("eip1967.proxy.implementation")) - 1);        
    }
    function _getImplementation() private view returns (address) {
        return StorageSlot.getAddressSlot(_getImplementationSlot()).value;
    }
    function _setImplementation(address newImplementation) private {
        require(Address.isContract(newImplementation), "ERC1967: new implementation is not a contract");
        StorageSlot.getAddressSlot(_getImplementationSlot()).value = newImplementation;
    }    

}
